def getPositions(array, lower, upper):
	i = 0
	lowerPos = 0
	upperPos = len(array)-1
	
	while True:
		if(array[i] >= lower):
			lowerPos = i
			break
		i+=1


	while True:
		if(array[i] >= upper):
			upperPos = i
			break
		i+=1
		
	return (lowerPos, upperPos)

def milis(vector):
	return np.divide(vector, 1000)

def seconds(vector):
	return np.divide(vector, 1000000)

def error(expected, actual):
	return np.abs(np.subtract(expected, actual))

def errorStats(error):
	return "| Error Medio: " + "{:.2f}".format(np.mean(error)) + " Error std: " + "{:.2f}".format(np.std(error)) + " Error Min: " + "{:.2f}".format(np.min(error)) + " Error Max: " + "{:.2f}".format(np.max(error)) 

